Node.nodeName.syntax:
var str = node.nodeName; str is a string variable storing the name of the current element. nodeName is a read-only attribute. Notes Here are the returned values for different types of nodes. Interface nodeName Attr same as Attr.name CDATASection "#cdata-section" Comment "#comment" Document "#document" DocumentFragment "#document-fragment" DocumentType same as DocumentType.name Element same as Element.tagName Entity entity name EntityReference name of entity reference Notation notation name ProcessingInstruction same as ProcessingInstruction.target text "#text" Example Given the following markup: <div id="d1">hello world</div><input type="text" id="t"/> and the following script: var div1 = document.getElementById("d1");
 or var text_field = document.getElementById("t");
 or text_field.value = div1.nodeName;);

