VideoPlaybackQuality.corruptedVideoFrame.syntax:
VideoPlaybackQuality.corruptedVideoFrames read-only property returns an unsigned long containing the number of corrupted video frames since the creation of the associated HTMLVideoElement. A corrupted frame may or may not be dropped, depending of the corruption and of the browser algorithm. Syntax value = videoPlaybackQuality.corruptedVideoFrames; Example var videoElt = document.getElementById("my_vid");
 or var quality = videoElt.getVideoPlaybackQuality();
 or alert(quality.corruptedVideoFrames);

VideoPlaybackQuality.creationTime.syntax:
VideoPlaybackQuality.creationTime read-only property returns a DOMHighResTimeStamp containing the time in miliseconds since the start of the navigation and the creation of the object. Syntax value = videoPlaybackQuality.creationTime; Example var videoElt = document.getElementById("my_vid");
 or var quality = videoElt.getVideoPlaybackQuality();
 or alert(quality.creationTime);

VideoPlaybackQuality.droppedVideoFrames.syntax:
VideoPlaybackQuality.droppedVideoFrames read-only property returns an unsigned long containing the number of video frames dropped since the creation of the associated HTMLVideoElement. Syntax value = videoPlaybackQuality.droppedVideoFrames; Example var videoElt = document.getElementById("my_vid");
 or var quality = videoElt.getVideoPlaybackQuality();
 or alert(quality.droppedVideoFrames);

VideoPlaybackQuality.totalFrameDelay.syntax:
VideoPlaybackQuality.totalFrameDelay read-only property returns a double containing the sum of the frame delay since the creation of the associated HTMLVideoElement. The frame delay is the difference between a frame's theoretical presentation time and its effective display time. Syntax value = videoPlaybackQuality.totalFrameDelay; Example var videoElt = document.getElementById("my_vid");
 or var quality = videoElt.getVideoPlaybackQuality();
 or alert(quality.totalFrameDelay);

VideoPlaybackQuality.totalVideoFrames.syntax:
VideoPlaybackQuality.totalVideoFrames read-only property returns an unsigned long containing the number of video frames created and dropped since the creation of the associated HTMLVideoElement. Syntax value = videoPlaybackQuality.totalVideoFrames; Example var videoElt = document.getElementById("my_vid");
 or var quality = videoElt.getVideoPlaybackQuality();
 or alert(quality.totalVideoFrames);

document.activeElement.syntax:
var curElement = document.activeElement; Example <!DOCTYPE HTML><html><head>    <script type="text/javascript" charset="utf-8">    function init() {        function onMouseUp(e) {            console.log(e);
 or             var outputElement = document.getElementById('output-element');
 or             var outputText = document.getElementById('output-text');
 or             var selectedTextArea = document.activeElement;            var selection = selectedTextArea.value.substring(            selectedTextArea.selectionStart, selectedTextArea.selectionEnd);
