throw expression;  Parameters expression The expression to throw. Description Use the throw statement to throw an exception. When you throw an exception, expression specifies the value of the exception. Each of the following throws an exception: throw "Error2"; // generates an exception with a string value throw 42; // generates an exception with the value 42 throw true; // generates an exception with the value true Examples Example: Throw an object You can specify an object when you throw an exception. You can then reference the object's properties in the catch block. The following example creates an object myUserException of type UserException and uses it in a throw statement. function UserException(message) {   this.message = message;   this.name = "UserException";}function getMonthName(mo) {   mo = mo-1; // Adjust month number for array index (1=Jan, 12=Dec)   var months = new Array("Jan", "Feb", "Mar", "Apr", "May", "Jun", "Jul",      "Aug", "Sep", "Oct", "Nov", "Dec");
 or    if (months[mo] !== undefined) {      return months[mo];   } else {      throw new UserException("InvalidMonthNo");
 or    }}try {   // statements to try   var myMonth = 15; // 15 is out of bound to raise the exception   monthName = getMonthName(myMonth);
 or } catch (e) {   monthName = "unknown";   logMyErrors(e.message, e.name);
 or  // pass exception object to err handler});

